import { useState } from "react";
import emailjs from "emailjs-com";
import React from "react";

const initialState = {
  name: "",
  email: "",
  message: "",
};

export const Contact = (props) => {
  const [{ name, email, message }, setState] = useState(initialState);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setState((prevState) => ({ ...prevState, [name]: value }));
  };

  const clearState = () => setState({ ...initialState });

  const handleSubmit = (e) => {
    e.preventDefault();

    emailjs
      .sendForm("YOUR_SERVICE_ID", "YOUR_TEMPLATE_ID", e.target, "YOUR_PUBLIC_KEY")
      .then(
        (result) => {
          console.log(result.text);
          clearState();
        },
        (error) => {
          console.log(error.text);
        }
      );
  };

  return (
    <div>
      <div id="contact">
        <div className="container-fluid">
          {/* Heading Section */}
          <div className="row first text-center mb-5">
            <div className="col-md-12">
              <h2>Get In Touch</h2>
              <p className="p1">
                At K & H Associates, we provide expert chartered accounting services.
              </p>
              <p className="p1">
                Whether you're a business or an individual, we’re here to ensure your
                financial affairs are managed efficiently and effectively.
              </p>
            </div>
          </div>

          {/* Form & Contact Info */}
          <div className="row d-flex justify-content-between">
            {/* Contact Form */}
            <div className="col-lg-8 col-md-7 section-title">
              <form name="sentMessage" onSubmit={handleSubmit}>
                <p className="p1 mb-4">
                  Please fill out the form below to send us an email. We’ll respond as soon as possible.
                </p>

                <div className="form-group mb-3">
                  <input
                    type="text"
                    id="name"
                    name="name"
                    className="form-control"
                    placeholder="Your Name"
                    required
                    onChange={handleChange}
                  />
                </div>
                <div className="form-group mb-3">
                  <input
                    type="email"
                    id="email"
                    name="email"
                    className="form-control"
                    placeholder="Your Email"
                    required
                    onChange={handleChange}
                  />
                </div>
                <div className="form-group mb-4">
                  <textarea
                    name="message"
                    id="message"
                    className="form-control"
                    rows="4"
                    placeholder="Your Message"
                    required
                    onChange={handleChange}
                  ></textarea>
                </div>
                <button type="submit" className="btn btn-custom btn-lg">
                  Send Message
                </button>
              </form>
            </div>

            {/* Contact Information */}
            <div className="col-lg-4 col-md-5">
              <div className="contact-info">
                <h3>Contact Info</h3>
                <p>
                  <span>
                    <i className="fa fa-map-marker"></i> Address:
                  </span>
                  {props.data ? props.data.address : "Loading..."}
                </p>
                <p>
                  <span>
                    <i className="fa fa-phone"></i> Phone:
                  </span>
                  {props.data ? props.data.phone : "Loading..."}
                </p>
                <p>
                  <span>
                    <i className="fa fa-envelope-o"></i> Email:
                  </span>
                  {props.data ? props.data.email : "Loading..."}
                </p>
              </div>

              {/* Social Icons */}
              <div className="social mt-4">
                <ul className="list-inline">
                  <li className="list-inline-item">
                    <a href={props.data?.facebook || "/"}>
                      <i className="fa fa-facebook"></i>
                    </a>
                  </li>
                  <li className="list-inline-item">
                    <a href={props.data?.twitter || "/"}>
                      <i className="fa fa-twitter"></i>
                    </a>
                  </li>
                  <li className="list-inline-item">
                    <a href={props.data?.youtube || "/"}>
                      <i className="fa fa-youtube"></i>
                    </a>
                  </li>
                </ul>
              </div>
            </div>
          </div> {/* end row */}
        </div>
      </div>

      {/* Footer */}
      <div id="footer">
        <div className="container text-center">
          <p>
            &copy; 2023 Issaaf Kattan React Land Page Template. Design by{" "}
            <a href="http://www.templatewire.com" rel="nofollow">
              TemplateWire
            </a>
          </p>
        </div>
      </div>
    </div>
  );
};
